`,N_=()=>po(I_,{children:[$e(co,{children:"資源回收目的"}),$e("br",{}),$e(mo,{children:"資源回收能預防浪費有潛在利用價值的資源、削減原料消耗，由此減少：能量消耗、空氣污染和水污染。收集本來要廢棄的材料，分解再製成新產品，或者是收集用過的產品，清潔、處理之後再出售。相對於垃圾遺棄，回收可以節省資源、降低溫室氣體排放。"}),$e("br",{}),$e("br",{}),$e(co,{children:"環保6R"}),$e("br",{}),po(mo,{children:["6R為垃圾減量之六項原則，分別為",$e("br",{}),$e("br",{}),"Reduce：減少丟棄之垃圾量",$e("br",{}),$e("br",{}),"Reuse：重複使用容器或產品",$e("br",{}),$e("br",{}),"Repair：重視維修保養，延長物品使用壽命",$e("br",{}),$e("br",{}),"Refuse：拒用無環保觀念產品 ",$e("br",{}),$e("br",{}),"Recycle：回收使用再生產品",$e("br",{}),$e("br",{}),"Recovery :（再生）指改變原料形態或其他物質結合，使再生資源產生功用之行為。例如沼氣發電、輪胎磨粉作為燃料，廢油回收做生質能源、廚餘回收做堆肥等。"]}),$e("br",{}),$e("br",{}),$e(co,{children:"回收項目"}),$e("br",{}),po(mo,{children:["回收項目分別為平面類、立體類、其他大型家具家電類及廚餘，根據項目不同處理方式亦有不同。",$e("br",{}),$e("br",{}),"•平面類：各種乾淨舊衣物 ,廢紙類 ,塑膠袋類 ,舊書。",$e("br",{}),$e("br",{}),"•立體類：分為一般類與保麗龍。",$e("br",{}),"一般類資源物：各類瓶罐、紙容器、小家電、電腦主機、壓克力等等。",$e("br",{}),"乾淨保麗龍：包水果的網狀塑膠材質。",$e("br",{}),$e("br",{}),"•其他類：照明光源燈管、電池、廢油 ,堆肥廚餘類 ,養豬廚餘類。其中大型傢俱家電需於約定時間回收。"]}),$e("br",{}),$e("br",{}),$e(co,{children:"資源回收管道"}),$e("br",{}),po(mo,{children:["1.清潔隊",$e("br",{}),"民眾將家中資源物於「資源回收日」交給清潔隊回收。",$e("br",{}),$e("br",{}),"2.資收個體戶、回收商",$e("br",{}),"查詢資源回收業者聯絡資料，請回收商協助回收。",$e("br",{}),$e("br",{}),"3.販賣場所回收點",$e("br",{}),"包括「批發或零售式量販業」、「連鎖式清潔及化妝品零售業」、「超級市場業」及「連鎖便利商店業」等皆設置有資源回收筒供民眾使用。",$e("br",{}),$e("br",{}),"4.公共場合回收設施",$e("br",{}),"加油站、車站、機場、高速公路休息站、風景區等場所的回收筒。"]}),$e("br",{}),$e("br",{}),$e(co,{children:"參考資料"}),$e("br",{}),po(mo,{children:[$e("a",{href:"https://www.dep-recycle.gov.taipei/News_Content.aspx?n=00F9222A04F318BE&s=B27E5D0C675F6AA3",children:"資源回收入口網-資源回收業務"}),$e("br",{}),$e("a",{href:"https://recycle.epa.gov.tw/Understanding/KnowLedge",children:"環保署資源回收網"})]})]}),ki=it.jsx,Ai=it.jsxs,v_=cr.useState,T_=Ie.div`
